Jason Sean Donovan (born 1 June 1968, Malvern, Melbourne) is an Australian actor and singer. In the UK, he has sold in excess of 3 million records, where his debut album Ten Good Reasons was the highest selling album of 1989 with sales of over 1.5 million copies. He has also had four UK no.1 singles, one of which was &quot;Especially for You&quot;, his 1988 duet with Kylie Minogue. In more recent years, he has has returned to acting on television and in stage musicals.




